import Card from '../Card'
import uwLogo from '../../resources/color-UWcrest-print.png'
import mePhoto from '../../resources/me.jpg'


export default class TopBarNav extends React.Component{
    constructor(props){
        super(props)
        this.state={
            cardHeight: 40
        }
    }

    render(){
        return(
            <div className='topbar'>

                {/* My name and wisconsin Image */}
                <Card clickable={false} height='100%' width='40vw' style={{}}>
                <img src={uwLogo} style={{ height: 70, maxWidth: 60}}></img>
                    <text style={{ fontFamily: 'arial', fontSize: 50, paddingLeft: 20, flex: 1 }}>
                        Max Johnson
                </text>
                </Card>

                {/* Home Button */}
                <Card clickable={true} height={this.state.cardHeight} width= '15vw'>
                    <text style={{paddingTop: 12,fontSize: 40, fontFamily: 'arial'}}>
                        Home
                    </text>
                </Card>

                {/* Projects Button */}
                <Card clickable={true} height={this.state.cardHeight} width= '15vw'>
                    <text style={{fontSize: 40, fontFamily: 'arial'}}>
                        Projects
                    </text>
                </Card>

                {/* Gallery Button */}
                <Card clickable={true} height={this.state.cardHeight} width= '15vw'>
                    <text style={{fontSize: 40, fontFamily: 'arial'}}>
                        Gallery
                    </text>
                </Card>

                {/** Contact Button */}
                <Card clickable={true} height={this.state.cardHeight} width= '15vw'>
                    <text style={{fontSize: 40, fontFamily: 'arial'}}>
                        Contact
                    </text>
                </Card>
                <style jsx >{`
                    .topbar {
                        margin:0;
                        padding:0;
                        border:0;
                        max-height:40;
                        max-width: 100%;
                        flex-direction: row;
                        display: flex;
                    }

                    .text {
                        font-size: 100;
                    }
                `}</style>
            </div>
        )
    }
}
